export const DefaultRed = /#d30000/g;

class UniformCatalog {

    private static _instance: UniformCatalog;

    private dominionWarSwatches = [
        new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(DominionWarBody1, BodyType.AverageMale, token), "BodyType.averageMale"),
//        new Swatch(BodyType.Body2, "Heftier Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody2, BodyType.Body2, token)),
//        new Swatch(BodyType.Body3, "Slighter Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody3, BodyType.Body3, token)),
//        new Swatch(BodyType.Body4, "Muscular Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody4, BodyType.Body4, token)),
        new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(DominionWarFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
//        new Swatch(BodyType.Body5, "Average", (token) => UniformCatalog.decorateSwatch(DominionWarBody5, BodyType.Body5, token)),
    ];

    private klingonSwatches = [
        new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(KlingonArmour.averageMaleNeck + KlingonArmour.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
        new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(KlingonArmour.averageFemaleNeck + KlingonArmour.averageFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
    ];

    public static get instance() {
        if (UniformCatalog._instance == null) {
            UniformCatalog._instance = new UniformCatalog();
        }
        return UniformCatalog._instance;
    }

    getBody(token: Token) {
        let result = DominionWarBody1;
        let seam = "";
        let neck = "";

        if (token.uniformEra === UniformEra.OriginalSeries) {
            return this.getUniformPack(token.uniformEra).getUniformAndVariantBody(token);
        } else if (token.uniformEra === UniformEra.Enterprise) {
            return this.getUniformPack(token.uniformEra).getUniformAndVariantBody(token);
        } else if (token.uniformEra === UniformEra.OriginalSeriesKlingon) {
            return this.getUniformPack(token.uniformEra).getUniformAndVariantBody(token);
        } else if (token.uniformEra === UniformEra.Klingon) {
            switch (token.bodyType) {
                case BodyType.AverageMale:
                    neck = KlingonArmour.averageMaleNeck;
                    result = KlingonArmour.averageMaleBody;
                    break;
                case BodyType.AverageFemale:
                default:
                    neck = KlingonArmour.averageFemaleNeck;
                    result = KlingonArmour.averageFemaleBody;
            }

            if (token.species === Species.Bolian) {
                switch (token.bodyType) {
                    case BodyType.AverageMale:
                        neck += BaseMaleBodyBolianNeckRidge;
                        break;
                    case BodyType.AverageFemale:
                        neck += BaseFemaleBolianNeckRidge;
                        break;
                    default:
                }
            }

        } else if (token.uniformEra === UniformEra.MonsterMaroon) {
            return this.getUniformPack(token.uniformEra).getUniformAndVariantBody(token);
        } else {

            if (token.species === Species.Bolian) {
                seam = DominionWarMaleBodyBolianRidge;
            }
            if (token.bodyType === BodyType.Body2) {
                result = DominionWarBody2;
            } else if (token.bodyType === BodyType.Body3) {
                result = DominionWarBody3;
            } else if (token.bodyType === BodyType.Body4) {
                result = DominionWarBody4;
            } else if (token.bodyType === BodyType.Body5) {
                result = DominionWarBody5;
            } else if (token.bodyType === BodyType.AverageFemale) {
                result = DominionWarFemaleBody;
                if (token.species === Species.Bolian) {
                    seam = DominionWarFemaleBodyBolianRidge;
                }
            }
        }

        return (neck + result + seam).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getSwatches(uniformEra: UniformEra) {
        if (uniformEra === UniformEra.OriginalSeries) {
            return this.getUniformPack(uniformEra).getUniformSwatches();
        } else if (uniformEra === UniformEra.Enterprise) {
            return this.getUniformPack(UniformEra.Enterprise).getUniformSwatches();
        } else if (uniformEra === UniformEra.OriginalSeriesKlingon) {
            return this.getUniformPack(uniformEra).getUniformSwatches();;
        } else if (uniformEra === UniformEra.Klingon) {
            return this.klingonSwatches;
        } else if (uniformEra === UniformEra.MonsterMaroon) {
            return this.getUniformPack(UniformEra.MonsterMaroon).getUniformSwatches();
        } else {
            return this.dominionWarSwatches;
        }
    }

    getUniformVariantSwatches(token: Token) {
        let uniformPack = this.getUniformPack(token.uniformEra);
        if (uniformPack != null) {
            return uniformPack.getUniformVariantSwatches(token);
        } else {
            return [];
        }
    }

    getUniformPack(era: UniformEra) {
        if (era === UniformEra.MonsterMaroon) {
            return new MonsterMaroonUniformPack();
        } else if (era === UniformEra.Enterprise) {
            return new EnterpriseUniformPack();
        } else if (era === UniformEra.OriginalSeries) {
            return new TosUniformPack();
        } else if (era === UniformEra.OriginalSeriesKlingon) {
            return new TosKlingonUniformPack();
        } else {
            return null;
        }
    }

    static decorateSwatch(svg: string, clipPathId: number, token: Token) {
        let result = `<svg viewBox="0 0 300 300" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="clipPath` + clipPathId + `">
                        <circle cx="150" cy="150" r="150" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#clipPath` + clipPathId + `">
                    <g transform="translate(-70, -130)">`
                    + svg.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor)
                + `</g>
                </g>
            </svg>`;
        return result;
    }
}

export default UniformCatalog;